			<p>Between April 22 and July 31, 2014 I <a href="http://www.strudel.org.uk/RTWbike/">recreated Thomas Stevens's 1884 bicycle trip across the US</a>. This is the elevation profile of <a href="https://github.com/slowe/RTWbike/blob/master/lowe2014real.geojson">my route</a> with some landmarks labelled.</p>

			<p class="footnote">Imperial units are used here as that is what I used during the trip.</p>
